const homePageModule = {
  state: {
    warriors: []
  },
  mutations: {
    SET_WARRIORS(state, warriors) {
      state.warriors = warriors;
    },
  },
  actions: {
    async httpArmyDetailGet({ commit }) {
      try {
        const data = await army.armyDetailGet();
        commit('SET_WARRIORS', data.data);
      } catch {
        (error) => Promise.reject(error);
      }
    },
  },
  getters: {}
};

  export default homePageModule
